_body: !!python/object:github.GithubObject._ValuedAttribute
  value: "Fixes a bug I introduced when I removed the code that set the first parameters\
    \ at high speed. Don't merge yet until I validate that this doesn't ruin the M8P\
    \ support (actively testing it now, I just wanted to get the PR through CI testing\
    \ sooner rather then later)\r\n\r\nThis should fix @peterbarker's recent problems\
